@RunWith(RobolectricRunner::class)
class PackageSearchAirportDropdownPresenterTest {

    private lateinit var widget: PackageSearchAirportDropdownPresenter
    private lateinit var activity: Activity
    private lateinit var backgroundDownloader: BackgroundDownloader
    val context: Context = RuntimeEnvironment.application

    @Before
    fun setup() {
        activity = Robolectric.buildActivity(FragmentActivity::class.java).create().get()
        activity.setTheme(R.style.V2_Theme_Packages)
        Ui.getApplication(activity).defaultPackageComponents()
        Ui.getApplication(activity).defaultTravelerComponent()
        setupFlightRoutes()
        inflate()
    }

    @Test
    fun testEndDrawablesForOriginAndDestinationCard() {

        val originCardDrawableResId = Shadows.shadowOf(widget.originCardView.compoundDrawablesRelative[2]).getCreatedFromResId()
        assertEquals(R.drawable.search_dropdown, originCardDrawableResId)

        val destinationCardDrawableResId = Shadows.shadowOf(widget.destinationCardView.compoundDrawablesRelative[2]).getCreatedFromResId()
        assertEquals(R.drawable.search_dropdown, destinationCardDrawableResId)
    }

    @Test
    fun testProgressDialogIsNotShownWhenFlightRoutesPresent() {

        assertNotNull(Db.sharedInstance.flightRoutes)
        assertFalse(widget.progressDialog.isShowing)
    }

    @Test
    fun testOriginAirportListPopupIsShown() {

        widget.originCardView.performClick()
        assertTrue(widget.originAirportListPopup.isShowing)
    }

    @Test
    fun testDestinationAirportListPopupIsShown() {

        widget.destinationCardView.performClick()
        assertTrue(widget.destinationAirportListPopup.isShowing)
    }

    @Test
    fun testOriginAirportListSelection() {

        val originObserver = TestObserver.create<SearchSuggestion>()

        widget.searchViewModel = PackageSearchViewModel(context)

        widget.originSuggestionViewModel.suggestionSelectedSubject.subscribe(originObserver)

        widget.originCardView.performClick()
        widget.originAirportListPopup.performItemClick(2)

        assertFalse(widget.originAirportListPopup.isShowing)
        assertEquals(1, widget.recentAirports.recentSearches.list.size)
        assertEquals(1, originObserver.valueCount())
    }

    @Test
    fun testOriginAirportListSelectionWithNull() {

        val originObserver = TestObserver.create<SearchSuggestion>()

        widget.searchViewModel = PackageSearchViewModel(context)

        widget.originSuggestionViewModel.suggestionSelectedSubject.subscribe(originObserver)

        widget.originCardView.performClick()
        widget.originAirportListPopup.performItemClick(1)

        assertTrue(widget.originAirportListPopup.isShowing)
        assertEquals(0, widget.recentAirports.recentSearches.list.size)
        assertEquals(0, originObserver.valueCount())
    }

    @Test
    fun testDestinationAirportListSelection() {

        widget.searchViewModel = PackageSearchViewModel(context)

        widget.destinationCardView.performClick()
        widget.destinationAirportListPopup.performItemClick(2)

        assertFalse(widget.destinationAirportListPopup.isShowing)
        assertEquals(1, widget.recentAirports.recentSearches.list.size)
    }

    @Test
    fun testDestinationAirportListSelectionWithNull() {

        widget.searchViewModel = PackageSearchViewModel(context)

        widget.destinationCardView.performClick()
        widget.destinationAirportListPopup.performItemClick(1)

        assertTrue(widget.destinationAirportListPopup.isShowing)
        assertEquals(0, widget.recentAirports.recentSearches.list.size)
    }

    @Test
    fun testBackButton() {
        widget.searchViewModel = PackageSearchViewModel(context)

        widget.originCardView.performClick()
        widget.back()

        assertFalse(widget.originAirportListPopup.isShowing)

        widget.destinationCardView.performClick()
        widget.back()
        assertFalse(widget.destinationAirportListPopup.isShowing)
    }

    @Test
    fun testRoutesCallback() {
        widget.searchViewModel = PackageSearchViewModel(context)

        val routesResponse = RoutesResponse()
        routesResponse.flightRoutes = getFlightRoutes()
        widget.mRoutesCallback.onDownload(routesResponse)

        assertFalse(widget.progressDialog.isShowing)

        widget.mRoutesCallback.onDownload(null)
        val dialog = ShadowDialog.getLatestDialog() as AlertDialog
        assertTrue(dialog.isShowing)
        assertEquals("Could not load AirAsia routes", dialog.findViewById<TextView>(android.R.id.message).text)
    }

    @Test
    fun testRoutesCallbackWithValidError() {
        widget.searchViewModel = PackageSearchViewModel(context)

        val routesResponseWithError = RoutesResponse()
        val serverError = ServerError()
        serverError.code = ServerError.ErrorCode.UNKNOWN_ERROR.name
        routesResponseWithError.addError(serverError)

        widget.mRoutesCallback.onDownload(routesResponseWithError)
        val dialog = ShadowDialog.getLatestDialog() as AlertDialog
        assertTrue(dialog.isShowing)
        assertEquals("Could not load AirAsia routes", dialog.findViewById<TextView>(android.R.id.message).text)
    }

    private fun inflate() {
        widget = LayoutInflater.from(activity).inflate(R.layout.test_package_search_airport_dropdown_presenter_test,
                null) as PackageSearchAirportDropdownPresenter
    }

